import React from "react";
import web from "../src/Images/two.jpg";

import { NavLink } from "react-router-dom";

const About=()=>{
    return(
        <>
        <section id="header" className="d-flex align-items-center">
        <div className="container-fluid nav_bg">
            <div className="row">
                <div className="col-10 mx-auto">
                <div className="row">
                    <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1 d-flex justify-content-center flex-column">
                        <h1>About Me</h1>
                        <h3>Hi,I am Umar Sarfaraz a front end Developer.</h3>
                        <h2 className="my-3">I am a front end web developer</h2>
                        <div className="mt-3">
                            <NavLink to="/about" className="btn btn-outline-primary">Get Started</NavLink>
                        </div>
                    </div>
                    <div className="col-lg-6 order-1 order-lg-2 header-img">
                        <img src={web} className="img-fluid animated" alt="homeimg"/>
                    </div>
                </div>
                </div>
            </div>
        </div>

        </section>

        </>
    );
};
export default About;
